import styled from "styled-components";

export const Container = styled.div`
  margin: 1% 0% 35% 35%;
  padding-left: 5px;
  width: 30%;
  height: 40%;
  text-align: center;
  border: 2px solid #2072d7b3;
  background-color: white;
  border-radius: 10px;
`;

export const Header = styled.h1`
  color: #000000;
  margin: auto;
  font-family: "Lucida Sans Unicode", "Lucida Grande", sans-serif;
  font-weight: 900;
  letter-spacing: 0px;
  font-size: 42px;
  padding-bottom: 5px;
  padding-top: 5px;
`;

export const Error = styled.h3`
  color: #dc143c;
  margin: auto;
  font-family: "Lucida Sans Unicode", "Lucida Grande", sans-serif;
  letter-spacing: 2px;
`;
